import React from 'react'
import {Grid} from '@material-ui/core'
interface IProps{
    
}

const PageLayout: React.FC<IProps> = (props) => {

    const {children} = props
    return(
        <Grid
            container>
            <Grid
                container>
                    Header
            </Grid>
            <Grid
                container>
                {children}
            </Grid>
        </Grid>
    )
}

export default PageLayout;
